/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`%`*/ /*!50003 TRIGGER `bf_enrolUpdate_ClassCountUpd` BEFORE UPDATE ON `enrolments` FOR EACH ROW insertTrigger: BEGIN
    IF @trigger_disabled = true THEN 
        LEAVE insertTrigger;
    ELSE
    #If enrolment was deactivated or reactivate.
    IF NEW.isValid = 0 THEN
        SET NEW.dropDate = NOW();
        SET NEW.dropReason = 'Deactivated';
    END IF;
    IF NEW.isValid = 1 AND OLD.isValid = 0 THEN
        SET NEW.dropDate = NULL;
        SET NEW.dropReason = '';
    END IF;
    IF NEW.dropDate < NOW() AND NEW.dropDate IS NOT NULL AND NEW.isValid = 1 THEN
        SET NEW.isValid = 0;
    END IF;
    END IF;
END */;;
